    //                             activeTag={props.activeTag}
    //                             special={true}/>);
    //     }
    //     else {
    //         tagsArray.push(<Tab setActiveTag={props.setActiveTag}
    //             activeTag={props.activeTag}
    //             special={false}/>);
    //     }

    // });


    return (
       <header>
           <div class="flex justify-start px-6 py-6">
            <img src={csclublogo} alt="Logo" width="85px" height="85px"/>
            {tabsArray}
           </div>
       </header> 
    )
}

export default Header
